define({"topics" : [{"title":"Step 1. Create and Start a Data Collector Receiving Pipeline","shortdesc":"\n               <p class=\"shortdesc\">Edge sending pipelines work in tandem with <span class=\"ph\">Data Collector</span>         pipelines. So after choosing the sample edge pipeline that you want to use, create and start         the corresponding\n                  <span class=\"ph\">Data Collector</span>         receiving pipeline. The <span class=\"ph\">Data Collector</span>         receiving pipeline must start before the edge sending pipeline.\n               </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/GettingStartedSamples.html#task_mxg_ltf_pbb","attributes": {"data-id":"task_mxg_ltf_pbb",},"menu": {"hasChildren":false,},"tocID":"task_mxg_ltf_pbb-d46e110710","topics":[]},{"title":"Step 2. Download and Install SDC Edge","shortdesc":"\n               <p class=\"shortdesc\">Download and install <span class=\"ph\">SDC Edge</span> on         each edge device where you want to run edge pipelines. All sample edge pipelines are         included in each\n                  <span class=\"ph\">SDC Edge</span>         installation.\n               </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/GettingStartedSamples.html#task_rg3_fyf_pbb","attributes": {"data-id":"task_rg3_fyf_pbb",},"menu": {"hasChildren":false,},"tocID":"task_rg3_fyf_pbb-d46e110744","topics":[]},{"title":"Step 3. Start SDC Edge and the Edge Pipeline","shortdesc":"\n               <p class=\"shortdesc\">Run a single command to start <span class=\"ph\">SDC Edge</span> and a         sample edge pipeline at the same time. You can then run additional commands to start         additional pipelines\n                  and to manage running pipelines after <span class=\"ph\">SDC Edge</span> is         running. \n               </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/GettingStartedSamples.html#task_vpd_rzf_pbb","attributes": {"data-id":"task_vpd_rzf_pbb",},"menu": {"hasChildren":false,},"tocID":"task_vpd_rzf_pbb-d46e110785","topics":[]}]});